import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Hero from './components/Hero/Hero';
import QRScanner from './components/QRScanner/QRScanner'; // Import the QRScanner component

function App() {
  return (
    <Router>
      <div className="App">
        {/* Define routes */}
        <Switch>
          <Route path="/" exact>
            <Hero />
          </Route>
          <Route path="/qr-scanner">
            <QRScanner />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
